    false,nt"url": null,nt"notes": "This side scan sonar imagery of the sea
    floor (50-80 m water depths) was mosaiced from acoustic data collected in 2004 aboard
    the NOAA ship McArthurII.A Klein System 3000 dual frequency side scan system was
    used for geophysical surveying, using only the 100Khz data to create the mosaic.
    A Trimble DSM212Ldifferential GPS was used for towfish positioning. Navigation from
    the GPS was logged in Hypack Max. Isis Sonar (Triton Imaging International) was
    used tolog the digital sonar packets and cable counter data.Sonar data were captured
    using the 150m range scale setting.",nt"license_title": null,nt"extras":
